            <a className="bruh" href="/experience">Work Experience</a><br/>
            <a className="bruh" href="/portfolio">Portfolio</a><br/>
          </li> */}
        </ul>
        {/* <a onClick={ this.showSettings } className="menu-item--small" href="">Settings</a> */}
      </Menu>
    );
  }
}

export default Navigation;

